### 1.2 Business Objectives\n","\n","1. How do annual members and casual riders use Cyclistic bikes differently?\n","2. Why would casual riders buy Cyclistic annual memberships?\n","3. How can Cyclistic use digital media to influence casual riders to become members?\n","\n","#### 1.3 Stakeholders\n","1. Lily Moreno: The director of marketing and my manager\n","\n","2. Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and reporting data that helps guide Cyclistic marketing strategy.\n","\n","3. Cyclistic executive team: The notoriously detail-oriented executive team that will decide whether to approve the recommended marketing program.\n","\n","4. Cyclistic: The consumers of the bike share company.\n","\n","\n","## Step 2: Prepare Phase\n","\n","#### 2.0 About the data\n"," I used a public data set from a public domain https://divvy-tripdata.s3.amazonaws.com/index.html as directed by my manager.The data set “divvy-tripdata” contains records of consumers while using the company's bikes rangining from the year 2018 - 2023 but i'd be anaylzing just the year 2020.\n"," \n"," \n","#### 2.1 Information in the dataset\n"," The data in question contains different datasets compromising of the rideable_types,stated_at,ended_at,station_names etc which are stored in long range formats. \n"," \n","#### Dataset Credibility\n","\n","1. Reliable: It is reliable because it covers all the activities of both casual and annual members.\n","\n","2. Original: The originality is low because the dataset is gotten from a third-party provider (https://divvy-tripdata.s3.amazonaws.com/index.html) and not from the comapny's database.\n","\n","3. Comprehensive: The data is comprehensive because it contains the adequate information that is used to solve the problem at hand.\n","\n","4. Current: The data is current as it was last updated a month ago.\n","\n","5. Citied: The data was gotten from https://divvy-tripdata.s3.amazonaws.com/index.html.\n","\n","\n","\n","## Step 3: Process\n","\n","### I am making use of the R studio as my tools because it's faster and reliable due the large number of datasets involved.\n","\n","I installed and loaded the packages I needed"]},{"cell_type":"code","execution_count":2,"id":"558cbb20","metadata":{"execution":{"iopub.execute_input":"2023-08-16T17:25:54.503604Z","iopub.status.busy":"2023-08-16T17:25:54.46934Z","iopub.status.idle":"2023-08-16T17:25:56.178776Z","shell.execute_reply":"2023-08-16T17:25:56.176915Z"},"papermill":{"duration":1.722876,"end_time":"2023-08-16T17:25:56.181582","exception":false,"start_time":"2023-08-16T17:25:54.458706","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\n","Attaching package: ‘data.table’\n","\n","\n","The following objects are masked from ‘package:lubridate’:\n","\n","    hour, isoweek, mday, minute, month, quarter, second, wday, week,\n","    yday, year\n","\n","\n","The following objects are masked from ‘package:dplyr’:\n","\n","    between, first, last\n","\n","\n","The following object is masked from ‘package:purrr’:\n","\n","    transpose\n","\n","\n","\n","Attaching package: ‘janitor’\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    chisq.test, fisher.test\n","\n","\n","\n","Attaching package: ‘psych’\n","\n","\n","The following objects are masked from ‘package:ggplot2’:\n","\n","    %+%, alpha\n","\n","\n","NOTE: Either Arial Narrow or Roboto Condensed fonts are required to use these themes.\n","\n","      Please use hrbrthemes::import_roboto_condensed() to install Roboto Condensed and\n","\n","      if Arial Narrow is not on your system, please see https://bit.ly/arialnarrow\n","\n","Registered S3 method overwritten by 'quantmod':\n","  method            from\n","  as.zoo.data.frame zoo \n","\n","\n","Attaching package: ‘formattable’\n","\n","\n","The following object is masked from ‘package:bigrquery’:\n","\n","    format_table\n","\n","\n"]}]